import { Grid } from "@mui/material";
import SideBar from "./SideBar/SideBar";
import AddTwist from "./Twist/AddTwist";
import Twist from "./Twist/Twist";
const Home = () => {
  return (
    <Grid container direction="row" justifyContent="space-between">
      <Grid item>
        <SideBar></SideBar>
      </Grid>
      <Grid
        item
        container
        direction="row"
        sx={{ border: "1px solid black" }}
        xs={6}
      >
        <Grid item>
          <AddTwist></AddTwist>
        </Grid>
        <Grid item>
          <Twist></Twist>
        </Grid>
      </Grid>
    </Grid>
  );
};

export default Home;
